import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import AboutScreen from './aboutscreen.js'
import './homescreen.css';

class HomeScreen extends Component {
	render() {
		return (
			<div className='container'>
				<div className='left-margin'>
				</div>

				<div className='main'>
					<ProjectButton
						title="3D Printer"
						description="A fused deposition modeling 3D printer designed in Autodesk Fusion 360 and built with T-Slotted Aluminum Extrusions"
						image="<INSERT IMAGE LINK HERE>"
						styleClass="project-container1"
						url="google.com"
					/>

					<ProjectButton
						title="Ion Thruster"
						description="An electromagnetic propulsion engine model designed in SolidWorks 2016 and constructued using a 3D printer."
						image="<INSERT IMAGE LINK HERE>"
						styleClass="project-container2"
						urlGo="google.com"
					/>

					<ProjectButton
						title="Cherishly App"
						description="A group photo sharing application created using React Native"
						image="<INSERT IMAGE LINK HERE>"
						styleClass="project-container3"
						urlGo="google.com"
					/>
				</div>

				<div className='right-margin'>
				</div>
			</div>
		);
	}
}

function ProjectButton(props){
	return (
		<div className={props.styleClass} onClick={ChangePage(props.url)}>
			<div className='project-title'>
				<h1>{props.title}</h1>
			</div>

			<div className='project-description'>
				<p> {props.description} </p>
			</div>

			<div className='project-image'>
				Insert image here {props.image}
			</div>
		</div>
	);
}

function ChangePage(url){

}

export default HomeScreen;
